import React from "react";

import "./Button.css";

function Button( { texto = "GG"  , laclase = "danger" , onClick = "" } = {}) {
	return (
		<button className={laclase} onClick={onClick}>
			<span></span>
			<p>{texto}</p>
		</button>
	);
}

// Button.defaultProps = {
// 	texto : "Texto no Seteado" , 
// 	laclase : "danger" , // primary , warning , danger , disabled
// }

export default Button;
